pragma solidity ^0.4.18;

import "./Ratings.sol";
import "../interfaces/IRewardsModel.sol";
import "../interfaces/IUserStorage.sol";
import "../interfaces/IForecasting.sol";

// Forecasting and Rewards
contract Forecasting is IForecasting {
    using SafeMathEx for uint64;
    using SafeMathEx for uint256;

    // Minimal number of participants to make the stats
    uint256 constant MIN_NUMBER_OF_FORECASTS = 10;

    // Min wings locked is 1 WINGS
    uint256 constant WINGS_LOCKED_MINIMUM = 1 ether;

    // Min FR involved in this FC which allows for spam checking
    uint256 constant SPAM_FR_THRESHOLD = 2000;

    // Interface to FR storage
    IUserStorage public userStorage;

    // Rewards logic
    IRewardsModel public rewardsModel;

    // Creates the contract
    function Forecasting(
        address _owner,
        address _manager,
        address _author,
        address _foundation,
        address _userStorage,
        address _rewardsModel,
        uint256 _durationInHours,
        uint256 _spamThreshold,
        uint256 _deviation
    )  public Version("1.8.0") isValidDuration(_durationInHours)
    {
        require(_spamThreshold <= 1000);
        require(_deviation > 1000 && _deviation < 2000);

        userStorage = IUserStorage(_userStorage);
        wingsToken = userStorage.token();
        owner = _owner;
        manager = _manager;
        author = _author;
        foundation = _foundation;
        duration = _durationInHours;
        rewardsModel = IRewardsModel(_rewardsModel);
        spamThreshold = _spamThreshold;
        deviation = _deviation;
        stage = Stage.Initial;

        FORECASTING_CREATED(owner,duration);
    }

    function() public payable {
        ethBalance += msg.value;
    }

    // Owner manually stops the process
    function stop()
        public onlyManager() beforeResultsAreReady()
    {
        // divide wings reserved for anti-spam between all forecasters
        uint256 count = forecastsCount.sub(forecastsCancelled);
        if (count > 0) {
            uint256 totalReward = wingsRewardForSpamReport;
            wingsRewardForSpamReport = totalReward / count;
            wingsRewardForSpamReportRemainder = totalReward % count;
        } else {
            // After that, everybody can call takeReward to transfer Wings deposit to foundation address
            forecastsCount = 0;
        }

        stage = Stage.StoppedByOwner;

        FORECASTING_STOPPED(forecastsCount);
    }

    // Called after ctor when instance address is known
    function setWingsDeposit(
        uint256 _wingsReserveAmount
    )
        public
        onlyOwner()
        duringInitialStage()
    {
        // >= is against possible attack
        require(wingsToken.balanceOf(address(this)) >= _wingsReserveAmount);
        wingsRewardForSpamReport = _wingsReserveAmount;
    }

    // Creates flatscale buckets - very costly operation
    function createFlatscaleBuckets(
        uint256 _minAmount,
        uint256 _maxAmount,
        uint256 _step
    )
        public
        onlyOwner()
        duringInitialStage()
    {
        rewardsModel.createFlatscaleBuckets(_minAmount, _maxAmount, _step);
        minAmount = _minAmount;
    }

    // Assigns timeframe and ensures anti-spam Wings are reserved.
    // Transfers stage to Stage.InProgress
    function startForecastingPeriod(
        uint256 _startTimestamp
    )
        public
        onlyOwner()
        duringInitialStage()
    {
        require(wingsRewardForSpamReport != 0);

        startTimestamp = _startTimestamp;
        endTimestamp = _startTimestamp + (duration * 1 hours);
        stage = Stage.InProgress;

        FORECASTING_SET_TIMEFRAME(startTimestamp, endTimestamp);
    }

    // In case forecasting is timeable and function startForecastingPeriod we should overload setTime
    function setTime(uint /*_start*/, uint /*_end*/) public onlyManager() before() {
        revert();
    }

    // Account adds its forecast for the 1st time
    function addForecast(
        uint256 _amount,
        bytes32 _message
    )
        public
        duringForecastingPeriod()
    {
        Forecast storage f = forecasts[msg.sender];
        require(f.state == FState.Invalid);

        // Will fail if msg.sender is not in storage
        uint64 FR;
        uint256 wingsLocked;
        (FR, wingsLocked) = userStorage.openProject(msg.sender, 0);

        require(wingsLocked >= WINGS_LOCKED_MINIMUM);

        (f.amount, f.weight) =
            rewardsModel.addForecast(_amount, wingsLocked, FR, startTimestamp, endTimestamp);


        uint256 ts = block.timestamp;

        f.originalAmount = _amount;
        f.wingsLocked = wingsLocked;
        f.created_at = ts;
        f.updated_at = ts;
        f.rating = FR;
        f.state = FState.Active;
        f.message = _message;

        userForecasts[forecastsCount++] = msg.sender;

        totalWingsLocked = totalWingsLocked.add(wingsLocked);
        totalWeight = totalWeight.add(f.weight);
        if (FR > 0) {
            totalFR = totalFR.add(FR);
            if (f.amount == 0) {
                totalFRForSpam = totalFRForSpam.add(FR);
                ++totalForecastsForSpam;
            }
        }

        FORECAST_ADD(msg.sender, f.wingsLocked, f.rating, f.weight, f.amount, f.originalAmount, f.message);
    }

    // Account changes its existing forecast
    function changeForecast(
        uint256 _amount,
        bytes32 _message
    )
        public
        duringForecastingPeriod()
    {
        Forecast storage f = forecasts[msg.sender];
        require(f.state == FState.Active);

        // XXX
        uint256 newWingsLocked = userStorage.lockWings(msg.sender, 0);
        assert(newWingsLocked >= f.wingsLocked);

        if (f.amount == 0 && f.rating > 0) {
            totalFRForSpam = totalFRForSpam.sub(f.rating);
            assert(totalForecastsForSpam > 0);
            --totalForecastsForSpam;
        }

        uint64 newWeight;
        (f.amount, newWeight) =
            rewardsModel.changeForecast(
                f.amount, _amount, newWingsLocked,
                f.weight, f.rating,
                startTimestamp, endTimestamp//, f.created_at TODO remove change penalty or not
            );

        totalWingsLocked = totalWingsLocked.sub(f.wingsLocked).add(newWingsLocked);
        totalWeight = totalWeight.sub(f.weight).add(newWeight);

        uint256 ts = block.timestamp;

        f.originalAmount = _amount;
        f.wingsLocked = newWingsLocked;
        f.weight = newWeight;
        f.updated_at = ts;
        f.message = _message;

        if (f.amount == 0 && f.rating > 0) {
            totalFRForSpam = totalFRForSpam.add(f.rating);
            ++totalForecastsForSpam;
        }

        FORECAST_CHANGE(msg.sender, f.wingsLocked, f.amount, f.originalAmount, f.weight, f.message);
    }

    // Account adds more locked wings to its forecast to increase weight
    function addNewWings(
        uint256 _amount
      )
        public
        duringForecastingPeriod()
    {
        Forecast storage f = forecasts[msg.sender];
        require(f.state == FState.Active);

        uint256 newWingsLocked = userStorage.lockWings(msg.sender, _amount);
        assert(newWingsLocked >= f.wingsLocked);

        uint64 newWeight = rewardsModel.addNewWings(f.amount, newWingsLocked, f.rating, f.weight);

        totalWingsLocked = totalWingsLocked.sub(f.wingsLocked).add(newWingsLocked);
        totalWeight = totalWeight.sub(f.weight).add(newWeight);

        f.wingsLocked = newWingsLocked;
        f.weight = newWeight;

        FORECAST_ADD_WINGS(msg.sender, f.wingsLocked, newWeight);
    }

    // Account closes its forecast and gets wings unlocked.
    // Depends on current stage:
    // 1) if stats are not ready then this is considered cancellation and the account gets negative dFR;
    // 2) if stats are made then the account gets dFR according to its accuracy
    // and then it take rewards as soon as they are available
    function closeForecast()
        public
    {
        Forecast storage f = forecasts[msg.sender];
        require(f.state == FState.Active);

        int32 dFR;
        if (uint8(stage) >= uint8(Stage.RewardsDistributed)) {
            // Stats are calculated, doing close
            dFR = closeForecastInternal(msg.sender, f);
        } else {
            // No stats made yet, doing cancel
            dFR = cancelForecastInternal(msg.sender, f);
        }

        FORECAST_CLOSE(msg.sender, dFR);
    }

    // Determines spam or not.
    // This fn is called after forecasting period finished and before crowdsale period.
    // Spam state is switched on if weighted ratio of forecasts for bucket 0
    // exceeds spamThreshold
    function checkForSpam()
        public
        onlyManager()
        afterForecastingPeriod()
    {
        stage = Stage.ReadyToMakeStats;

        if (spamThreshold == 0 ||
            totalFR < SPAM_FR_THRESHOLD ||
            forecastsCount.sub(forecastsCancelled) < MIN_NUMBER_OF_FORECASTS
        ) {
            // spam checking is off for this project or not enough stats
            FORECAST_NOT_DETECT_SPAM();
            return;
        }

        uint256 spamFactor = totalFRForSpam.mul(1000) / totalFR;
        if (spamFactor > spamThreshold) {
            // valueOfPoll in spam case is simply FR ratio
            valueOfPoll = totalFR.mul(1000) / userStorage.totalFR();
            stage = Stage.IsSpam;

            uint256 totalReward = wingsRewardForSpamReport;
            wingsRewardForSpamReport = totalReward / totalForecastsForSpam;
            wingsRewardForSpamReportRemainder = totalReward % totalForecastsForSpam;

            FORECAST_DETECT_SPAM(spamFactor);
        } else {
          FORECAST_NOT_DETECT_SPAM();
        }
    }

    // Rewards are distributed among forecasts in this function
    // _amount - ETH collected by crowdsale if succeeded or min amount needed if it failed
    function makeStats(
        uint256 _amount,
        uint256 _reward,
        bool _crowdsaleSucceeded
    )
        public
        onlyOwner()
        afterCheckedForSpam()
    {
        // Not a spam, lets transfer Wings back to author
        bool rewardsDistributed;
        uint256 quartileCoefficient;

        if (!_crowdsaleSucceeded) {
            stage = Stage.CrowdsaleFailed;
            minAmount = _amount;

            (rewardsDistributed, quartileCoefficient)
                = rewardsModel.distributeRewards(0, 0, 0, totalWeight);

            if (quartileCoefficient > 0) {
                determineValueOfPoll(quartileCoefficient);
            }
            return;
        }

        if (forecastsCount.sub(forecastsCancelled) < MIN_NUMBER_OF_FORECASTS) {
            stage = Stage.ForecastingFailed;
            return;
        }

        require(_amount > 0 && _reward > 0);

        (rewardsDistributed, quartileCoefficient) =
            rewardsModel.distributeRewards(deviation, _amount, _reward, totalWeight);

        if (quartileCoefficient > 0) {
            determineValueOfPoll(quartileCoefficient);
        }

        stage = rewardsDistributed ? Stage.RewardsDistributed : Stage.NoReward;

        FORECAST_STATS_MADE(rewardsDistributed);
    }

    // Called by crowdsale contract to make sure rewards are here
    // _reward - ETH or project's tokens to be rewarded
    // _rewardProportion - if not zero then ETH is also rewarded
    function prepareToGiveRewards(address _projectToken, uint256 _ethReward, uint256 _tokenReward)
        public
        onlyOwner()
        whenRewardsDistributed()
    {
        projectToken = ERC20(_projectToken);
        ethReward = _ethReward;
        tokenReward = _tokenReward;

        // Soft rules here (>=) are against possible attacks

        if (_ethReward != 0) {
            require(ethBalance >= _ethReward);
        }

        require(projectToken.balanceOf(address(this)) >= _tokenReward);

        // authors have done everything they were required - lets return them Wings
        require(wingsToken.transfer(author, wingsToken.balanceOf(address(this))));

        stage = Stage.ReadyToGiveRewards;

        FORECAST_READY_TO_GIVE_REWARDS();
    }

    // Account takes its reward in project's token
    // (this is a distinct function because project's token can be 3rd party)
    function takeReward()
        public
        afterResultsAreReady()
        protectAgainstReentrancy()
    {
        if (stage == Stage.ReadyToGiveRewards) {
            // give rewards to forecaster

            Forecast storage f = forecasts[msg.sender];
            require(f.state == FState.Closed); // be sure it's not zero

            uint256 reward = f.rewardPending;

            if (reward != 0) {
                f.rewardPending = 0;

                if (ethReward != 0) {
                    uint256 tokensAmount = reward.mul(tokenReward).div(ethReward);

                    require(projectToken.transfer(msg.sender, tokensAmount));
                    ethBalance = ethBalance.sub(reward);
                    require(msg.sender.send(reward));

                    FORECAST_REWARD_TAKE(msg.sender, ethBalance, tokensAmount);
                } else {
                    require(projectToken.transfer(msg.sender, reward));
                    FORECAST_REWARD_TAKE(msg.sender, 0, reward);
                }
            }
            return;
        }

        uint256 toWithdraw = 0;

        if (stage == Stage.StoppedByOwner) {
            if (forecastsCount == 0 && wingsRewardForSpamReport > 0) {
                // transfer everything to foundation in case of project cancelled and no forecasts
                toWithdraw = wingsToken.balanceOf(address(this));
                require(wingsToken.transfer(foundation, toWithdraw));
                wingsRewardForSpamReport = 0;

                FORECAST_DEPOSIT_WITHDRAW(msg.sender, toWithdraw);
            }
            return;
        }

        if (stage == Stage.NoReward || stage == Stage.CrowdsaleFailed || stage == Stage.ForecastingFailed) {
            if (wingsRewardForSpamReport > 0) {
                // return all Wings to author
                // XXX:  what to do if CrowdsaleFailed ???
                toWithdraw = wingsToken.balanceOf(address(this));
                require(wingsToken.transfer(author, toWithdraw));
                wingsRewardForSpamReport = 0;

                FORECAST_DEPOSIT_WITHDRAW(msg.sender, toWithdraw);
            }
            return;
        }
    }

    // Returns forecast state and pending results for a given address,
    // User can see non-zero amounts while its forecast is active (not closed)
    function getForecastStateAndResults(
        address _user
    )
        public
        constant
        afterStatsMade()
        returns(FState forecastState, int32 dFR, uint256 rewardInEth, uint256 rewardInProjectToken, uint256 rewardInWings)
    {
        require(_user != address(0));
        var f = forecasts[_user];

        forecastState = f.state;
        if (f.state != FState.Active) {
            return;
        }

        uint256 reward;
        Levels.Quality q;

        if (stage == Stage.ReadyToGiveRewards || stage == Stage.RewardsDistributed) {
            (reward, q) = rewardsModel.getReward(f.amount, f.weight);
            if (ethReward != 0) {
                rewardInEth = reward;
                rewardInProjectToken = reward.mul(tokenReward).div(ethReward);
            } else {
                rewardInProjectToken = reward;
            }
            dFR = Ratings.getFRChange(valueOfPoll, f.wingsLocked, q);
        } else if (stage == Stage.NoReward) {
            q = rewardsModel.getForecastQuality(f.amount);
            dFR = Ratings.getFRChange(valueOfPoll, f.wingsLocked, q);
        } else if (stage == Stage.CrowdsaleFailed && f.amount <= minAmount) {
            // minimal positive reward
            dFR = Ratings.getFRChange(valueOfPoll, f.wingsLocked, Levels.Quality.B);
        } else if (stage == Stage.IsSpam) {
            bool hasWingsReward = (f.amount == 0 && f.rating > 0);
            dFR = Ratings.getFRChangeIfSpam(
                valueOfPoll,
                hasWingsReward
            );
            if (hasWingsReward) {
                rewardInWings = wingsRewardForSpamReport;
            }
        } else if (stage == Stage.StoppedByOwner) {
            rewardInWings = wingsRewardForSpamReport;
        }
    }

    // Get FC data by user
    function getByUser(address _user)
        public
        constant
        returns (uint, uint, uint64, uint64, uint8, uint, bytes32, uint, uint)
    {
        var forecast = forecasts[_user];
        return (forecast.amount, forecast.originalAmount, forecast.rating, forecast.weight, uint8(forecast.state), forecast.wingsLocked, forecast.message, forecast.created_at, forecast.updated_at);
    }

    // Get FC data by index
    function get(uint _index)
        public
        constant
        returns (address, uint, uint, uint64, uint64, uint8, uint, bytes32, uint, uint)
    {
        address owner = userForecasts[_index];
        var forecast = forecasts[owner];
        return (owner, forecast.amount, forecast.originalAmount, forecast.rating, forecast.weight, uint8(forecast.state), forecast.wingsLocked, forecast.message, forecast.created_at, forecast.updated_at);
    }

    // Will revert() if crowdsale range does not fit into buckets range
    function approveCrowdsaleRange(uint256 _minimalGoal, uint256 _hardCap)
        public
        constant
    {
        rewardsModel.approveCrowdsaleRange(_minimalGoal, _hardCap);
    }

    // For custom crowdsales, fits totalCollected into range if custom crowdsale authors
    // went a bit wrong with those results...
    function fitCollectedValueIntoRange(uint256 _totalCollected)
        public
        constant
        returns (uint256)
    {
        return rewardsModel.fitCollectedValueIntoRange(_totalCollected);
    }

    // calculates valueOfPoll
    function determineValueOfPoll(
        uint256 quartileCoefficient
    )
        internal
    {
        uint256 v;

        // TODO: finally choose formula after some experiments
        // Formula1 : with FR

        if (totalFR > 0) {
            v = totalFR.mul(1000) / userStorage.totalFR();
        }
        if (v < 50) v = 50;

        v = v.mul(totalWingsLocked) / userStorage.totalLocked();

        valueOfPoll = v.mul(quartileCoefficient) / 4000; // TODO adjust this "4000" to normalize to sane FR range

        FORECAST_VALUE_OF_POLL(valueOfPoll);

        // Formula2: without FR
/*
        v = totalWingsLocked.mul(1000) / userStorage.totalLocked();
        v = v.mul(v).mul(quartileCoefficient);

        valueOfPoll = v / 4000000; // TODO the same as in F1
*/
    }

    // Close forecast implementation
    function closeForecastInternal(
        address _account,
        Forecast storage _f
    )
        internal
        returns (int32)
    {
        int32 dFR;
        uint256 reward;
        bool needTransferWings;
        Levels.Quality q;

        if (stage == Stage.ReadyToGiveRewards || stage == Stage.RewardsDistributed) {
            // In these stages, if the account has some reward, it can take it
            // by calling takeReward() after project owners close Forecasting
            // and make tokens (and optionally ETH) available for rewarding

            (reward, q) = rewardsModel.takeReward(_f.amount, _f.weight);
            dFR = Ratings.getFRChange(valueOfPoll, _f.wingsLocked, q);
            _f.rewardPending = reward;

        } else if (stage == Stage.IsSpam) {
            // Spam case: account takes its part of project owner's Wings deposit
            // if it reported spam

            needTransferWings = (_f.amount == 0 && _f.rating > 0);
            dFR = Ratings.getFRChangeIfSpam(
                valueOfPoll,
                needTransferWings
            );

        } else if (stage == Stage.NoReward) {
            // No rewards distributed because of out of range forecasts,
            // Accounts still take dFR

            q = rewardsModel.getForecastQuality(_f.amount);
            dFR = Ratings.getFRChange(valueOfPoll, _f.wingsLocked, q);

        } else if (stage == Stage.CrowdsaleFailed && _f.amount <= minAmount) {
            // Crowdsale failed: accounts who voted for amounts <= collected
            // take minimal positive dFR

            dFR = Ratings.getFRChange(valueOfPoll, _f.wingsLocked, Levels.Quality.B);

        } else if (stage == Stage.StoppedByOwner) {
            // Project was cancelled by owner: Wings deposit is divided among forecasters

            needTransferWings = true;
        }

        userStorage.closeProject(_account, dFR, false);

        _f.state = FState.Closed;

        if (needTransferWings) {
            uint256 sum = wingsRewardForSpamReport;
            if (wingsRewardForSpamReportRemainder > 0) {
                sum = sum.add(wingsRewardForSpamReportRemainder);
                wingsRewardForSpamReportRemainder = 0;
            }

            if (!wingsToken.transfer(_account, sum)) {
                revert();
            }
        }

        FORECAST_RESULT_TAKE(_account, reward, dFR);

        return dFR;
    }

    // Cancel forecast implementation
    function cancelForecastInternal(
        address _account,
        Forecast storage _f
    )
        internal
        returns (int32)
    {
        rewardsModel.removeForecast(_f.amount, _f.weight);
        ++forecastsCancelled;

        int32 dFR = Ratings.getFRChange(250, _f.wingsLocked, Levels.Quality.E);

        userStorage.closeProject(_account, dFR, true);

        totalWingsLocked = totalWingsLocked.sub(_f.wingsLocked);
        totalWeight = totalWeight.sub(_f.weight);
        totalFR = totalFR.sub(_f.rating);
        if (_f.amount == 0 && _f.rating > 0) {
            totalFRForSpam = totalFRForSpam.sub(_f.rating);
            assert(totalForecastsForSpam > 0);
            --totalForecastsForSpam;
        }

        // account can post forecast again because of this state (if period allows)
        //_f.state = FState.Invalid;

        // XXX: returning back: account cannot reopen its FC
        _f.state = FState.Cancelled;

        FORECAST_CANCEL(_account, dFR);

        return dFR;
    }

    // Gets FR change in case of forecast cancellation
    function getFRCancelForecastChange() public view returns (int32 dFR) {
      Forecast memory f = forecasts[msg.sender];
      dFR = Ratings.getFRChange(250, f.wingsLocked, Levels.Quality.E);
    }
}
